import React from 'react';

const RecentlyPlayed = ({recentlyPlayed, chooseTrack}) => {
    const handlePlay=()=>{
        console.log(recentlyPlayed)
          chooseTrack(recentlyPlayed)
      }

    console.log(recentlyPlayed)
    return (
        <div className="recentlyplayed">
            <div className="rpheader">Recently Played Tracks</div>
            <div className="rptracks">
            {recentlyPlayed.map((track, index)=>(

                <div key={index} className="rpwrap">
                    <img onClick={handlePlay} src={track.track.album.images[2].url}/>
                    <div onClick={handlePlay}className="rptext">
                    {track.track.name}
                    <br/>
                    <div onClick={handlePlay}className="grey"> {track.track.artists[0].name} </div>
                    </div>
                </div>

            ))}

            </div>
        </div>
    );
};

export default RecentlyPlayed;
